#
# TABLE STRUCTURE FOR: disease
#

DROP TABLE IF EXISTS `disease`;

CREATE TABLE `disease` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `name` varchar(10) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название',
  `description` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Описание болезни',
  `created_at` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Болезни';



#
# TABLE STRUCTURE FOR: doctor
#

DROP TABLE IF EXISTS `doctor`;

CREATE TABLE `doctor` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `employee_id` int(10) unsigned NOT NULL COMMENT 'ID работника',
  `speciality` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Специальность',
  `created_at` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `employee_id` (`employee_id`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Докторы';



#
# TABLE STRUCTURE FOR: drug
#

DROP TABLE IF EXISTS `drug`;

CREATE TABLE `drug` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `name` varchar(10) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Название',
  `description` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Описание лекарства',
  `price` int(10) unsigned DEFAULT NULL COMMENT 'Цена',
  `created_at` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Лекарства';



#
# TABLE STRUCTURE FOR: employee
#

DROP TABLE IF EXISTS `employee`;

CREATE TABLE `employee` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `start_date` datetime DEFAULT NULL COMMENT 'Дата поступления на работу',
  `end_date` datetime DEFAULT NULL COMMENT 'Дата увольнения',
  `polis_number` int(10) unsigned NOT NULL COMMENT 'Номер полиса',
  `description` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Описание работника',
  `experience` int(10) unsigned DEFAULT NULL COMMENT 'Опыт работы в годах',
  `salary` decimal(6,2) NOT NULL COMMENT 'Зарплата',
  `email` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Почта',
  `created_at` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `polis_number` (`polis_number`),
  UNIQUE KEY `email` (`email`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Работники';



#
# TABLE STRUCTURE FOR: medical_card
#

DROP TABLE IF EXISTS `medical_card`;

CREATE TABLE `medical_card` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `patient_id` int(10) unsigned NOT NULL COMMENT 'ID пациента',
  `allergy` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Есть ли аллергия у пациента',
  `past_illness` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Перенесенные заболевания пациента',
  `symptoms` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Симптоматика пациента',
  `disease_id` int(10) unsigned DEFAULT NULL COMMENT 'ID болезни',
  `diagnosis` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Диагноз пациента',
  `created_at` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `patient_id` (`patient_id`)
) ENGINE=InnoDB AUTO_INCREMENT=401 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Карта пациента';



#
# TABLE STRUCTURE FOR: nurse
#

DROP TABLE IF EXISTS `nurse`;

CREATE TABLE `nurse` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `employee_id` int(10) unsigned NOT NULL COMMENT 'ID работника',
  `speciality` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Специальность',
  `created_at` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `employee_id` (`employee_id`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Медсестры';



#
# TABLE STRUCTURE FOR: patient
#

DROP TABLE IF EXISTS `patient`;

CREATE TABLE `patient` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `admission_date` datetime DEFAULT NULL COMMENT 'Время поступления в больницу',
  `discharge_date` datetime DEFAULT NULL COMMENT 'Время выписки из больницы',
  `polis_number` int(10) unsigned NOT NULL COMMENT 'Номер полиса',
  `created_at` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `polis_number` (`polis_number`)
) ENGINE=InnoDB AUTO_INCREMENT=401 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Пациенты';



#
# TABLE STRUCTURE FOR: people
#

DROP TABLE IF EXISTS `people`;

CREATE TABLE `people` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `first_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Имя',
  `last_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Фамилия',
  `sex` varchar(10) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Пол',
  `phone` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Телефон',
  `address` varchar(200) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Адрес',
  `age` int(10) unsigned DEFAULT NULL COMMENT 'Возраст',
  `polis_number` int(10) unsigned NOT NULL COMMENT 'Номер полиса',
  `created_at` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `phone` (`phone`),
  UNIQUE KEY `polis_number` (`polis_number`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Люди';



#
# TABLE STRUCTURE FOR: prescription
#

DROP TABLE IF EXISTS `prescription`;

CREATE TABLE `prescription` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `patient_id` int(10) unsigned NOT NULL COMMENT 'ID пациента',
  `drug_id` int(10) unsigned DEFAULT NULL COMMENT 'ID лекарства',
  `quantity` int(10) unsigned DEFAULT NULL COMMENT 'Количество',
  `created_at` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  UNIQUE KEY `patient_id` (`patient_id`)
) ENGINE=InnoDB AUTO_INCREMENT=401 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Лекарства пациента';




#
# TABLE STRUCTURE FOR: room
#

DROP TABLE IF EXISTS `room`;

CREATE TABLE `room` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `room_floor` int(10) unsigned DEFAULT NULL COMMENT 'Этаж комнаты',
  `room_department` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Отделение',
  `created_at` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=301 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Комнаты';



#
# TABLE STRUCTURE FOR: room_patient
#

DROP TABLE IF EXISTS `room_patient`;

CREATE TABLE `room_patient` (
  `room_id` int(10) unsigned DEFAULT NULL COMMENT 'ID комнаты',
  `patient_id` int(10) unsigned DEFAULT NULL COMMENT 'ID пациента',
  `created_at` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'Время создания строки'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Комнаты с пациентами';



#
# TABLE STRUCTURE FOR: visit
#

DROP TABLE IF EXISTS `visit`;

CREATE TABLE `visit` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `date_visit` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'Время визита',
  `patient_id` int(10) unsigned DEFAULT NULL COMMENT 'ID пациента',
  `employee_id` int(10) unsigned DEFAULT NULL COMMENT 'ID работника',
  `reason_for_visit` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Причина визита',
  `name` varchar(10) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT 'Имя пациента',
  `created_at` datetime NOT NULL DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=401 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='Лекарства';



